The 556R (Russian) is a wonderful gun worth doing the research on.  It is considered by knowledgeable professionals as comparable to, and sometimes better than, high end, customized AK47s.  The rifle hasn't been fired.  It was manufactured at the very end of last year and has all the improvements made by Sig Sauer.  Also installed on the rifle is the "Zurich wedge" recommended by Gabe Suarez which tightens the rifle up and improves the accuracy of the rifle.  

The sale includes:
Rifle; Sig 556R (Russian 7.62x39mm)  
Midwest Industries flip up front and rear sight; 
SIG Sauer STS-081 mini red dot sight; 
BDS tactical 2-point/1-point quick adjust bungee sling; 
Zurich wedge; 
QD 30mm scope mount; 
Seven Tapco 30 round AK47 magazine; 
one steel 10 round AK47 magazine; 
Wilson tennis racket bag (popular for carrying rifles with side folding stocks such as the Sig 500 series); 
original box, paperwork and lock.  
one four magazine carrying pouch

Cash only.  Price firm, $2200 OBO.

For ammo see my other listing: 
http://www.armslist.com/posts/1549219/springfield-missouri-ammo-for-sale--7-62x39-2500-rounds-tulammo

Description:  SIG SAUER® is offering several variants to its tactical platforms. Leading the way is our new SIG556 Russian, chambered for the widely used 7.62 x 39mm caliber. Using AK-type magazines, the shooter now has a more potent round for small to medium game. The SIG556R features a Swiss folding stock, and an M1913 rail for accessory attachment. The 16” barrel features four-groove rifling and a twist rate of 1:9.5”. The SIG556R measures 35.875” but can fold to 26”, making it ideal for situations where maximum maneuverability is required. For Special Forces requiring an accurate, more potent rifle, chambered in 7.62x39mm, the SIG556R sets a new standard for dependable
 operation and function.

